import React, { useState } from "react";
import "./addFinInfo.css";

function AddFinInfo() {
  const [selectedOption, setSelectedOption] = useState("");
  const [cardNumber, setCardNumber] = useState("");
  const [ccv, setCcv] = useState("");
  const [expDate, setExpDate] = useState("");
  const [nameOnFile, setNameOnFile] = useState("");
  const [accountNumber, setAccountNumber] = useState("");
  const [routingNumber, setRoutingNumber] = useState("");
  const [swiftCode, setSwiftCode] = useState("");

  const handleOptionChange = (event) => {
    setSelectedOption(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();

    // Handle form submission here
    console.log({
      selectedOption,
      cardNumber,
      ccv,
      expDate,
      nameOnFile,
      accountNumber,
      routingNumber,
      swiftCode,
    });

    // Reset form fields
    setSelectedOption("");
    setCardNumber("");
    setCcv("");
    setExpDate("");
    setNameOnFile("");
    setAccountNumber("");
    setRoutingNumber("");
    setSwiftCode("");
  };

  return (
    <div className="add-fin-info-container">
      <h2>Add Financial Information</h2>
      <form onSubmit={handleSubmit}>
        <div className="radio-group">
          <label>
            <input
              type="radio"
              value="credit-debit"
              checked={selectedOption === "credit-debit"}
              onChange={handleOptionChange}
            />
            Credit/Debit
          </label>
          <label>
            <input
              type="radio"
              value="us-bank"
              checked={selectedOption === "us-bank"}
              onChange={handleOptionChange}
            />
            US Bank
          </label>
          <label>
            <input
              type="radio"
              value="international-bank"
              checked={selectedOption === "international-bank"}
              onChange={handleOptionChange}
            />
            International Bank
          </label>
        </div>
        {selectedOption === "credit-debit" && (
          <>
            <div className="form-group">
              <label htmlFor="card-number">Card Number:</label>
              <input
                type="text"
                id="card-number"
                value={cardNumber}
                onChange={(event) => setCardNumber(event.target.value)}
              />
            </div>
            <div className="form-group">
              <label htmlFor="ccv">CCV:</label>
              <input
                type="text"
                id="ccv"
                value={ccv}
                onChange={(event) => setCcv(event.target.value)}
              />
            </div>
            <div className="form-group">
              <label htmlFor="exp-date">EXP Date:</label>
              <input
                type="text"
                id="exp-date"
                value={expDate}
                onChange={(event) => setExpDate(event.target.value)}
              />
            </div>
            <div className="form-group">
              <label htmlFor="name-on-file">Name on File:</label>
              <input
                type="text"
                id="name-on-file"
                value={nameOnFile}
                onChange={(event) => setNameOnFile(event.target.value)}
              />
            </div>
          </>
        )}
                    {selectedOption === "us-bank" && (
                    <>
                    <div className="form-group">
                    <label htmlFor="account-number">Account Number:</label>
                    <input
                    type="text"
                    id="account-number"
                    value={accountNumber}
                    onChange={(event) => setAccountNumber(event.target.value)}
                    />
                    </div>
                    <div className="form-group">
                    <label htmlFor="routing-number">Routing Number:</label>
                    <input
                    type="text"
                    id="routing-number"
                    value={routingNumber}
                    onChange={(event) => setRoutingNumber(event.target.value)}
                    />
                    </div>
                    <div className="form-group">
                    <label htmlFor="name-on-file">Name on File:</label>
                    <input
                    type="text"
                    id="name-on-file"
                    value={nameOnFile}
                    onChange={(event) => setNameOnFile(event.target.value)}
                    />
                    </div>
                    </>
                    )}
                    {selectedOption === "international-bank" && (
                    <>
                    <div className="form-group">
                    <label htmlFor="account-number">Account Number:</label>
                    <input
                    type="text"
                    id="account-number"
                    value={accountNumber}
                    onChange={(event) => setAccountNumber(event.target.value)}
                    />
                    </div>
                    <div className="form-group">
                    <label htmlFor="routing-number">Routing Number:</label>
                    <input
                    type="text"
                    id="routing-number"
                    value={routingNumber}
                    onChange={(event) => setRoutingNumber(event.target.value)}
                    />
                    </div>
                    <div className="form-group">
                    <label htmlFor="swift-code">Swift Code:</label>
                    <input
                    type="text"
                    id="swift-code"
                    value={swiftCode}
                    onChange={(event) => setSwiftCode(event.target.value)}
                    />
                    </div>
                    <div className="form-group">
                    <label htmlFor="name-on-file">Name on File:</label>
                    <input
                    type="text"
                    id="name-on-file"
                    value={nameOnFile}
                    onChange={(event) => setNameOnFile(event.target.value)}
                    />
                    </div>
                    </>
                    )}
                    <button type="submit">Save</button>
                    </form>
                    </div>
                    );
                    }
                    
                    export default AddFinInfo;
